import React from 'react';

import axios from 'axios';

export default class statusList extends React.Component {
  state = {
    status: []
  }

  componentDidMount() {
    axios.get('https://cdn.statuspage.io/se-v2.js')
      .then(res => {
        const status = res.data.components;
        this.setState({ status });
        console.log(status);
      })
  }

  render() {
    return (
      <ul>
        { this.state.status.map(comp => <li>{comp.name} | {comp.status}</li>)}
      </ul>
    )
  }
}
